#Function to populate dictionary with player name/Hero
def Player_Creation(Hero):
    global y
    for row in sheet_obj.iter_rows(1):
        for cell in row:
            if cell.value == Hero:
                z = (sheet_obj.cell(row=(cell.row), column=(2)).value)
                x = 0
                if z == 0:
                    pass
                else:
                    while x < int(z):
                        New_Player = "Player" + str(y)
                        Player_List[New_Player] = Hero
                        y +=1
                        x +=1
                return y

 

