#Swiss Pairings Logic
def generate_pairings(players, previous_pairings=None, results=None):
    pairings = []
    if previous_pairings is None:
        previous_pairings = set()  # Initialize an empty set for previous pairings
    if results is None:
        results = {}  # Initialize an empty dictionary for results
    
    # Group players based on their current results
    result_groups = {}
    for player in players:
        result = results.get(player, 0)
        if result not in result_groups:
            result_groups[result] = []
        result_groups[result].append(player)


    
    # Sort result groups based on results
    sorted_result_groups = sorted(result_groups.items(), key=lambda x: x[0], reverse=True)


    # Pair players with similar results
    for i, (result, group) in enumerate(sorted_result_groups):
        if len(group) % 2 != 0:
            # If there's an odd number of players in the group, try to pair with the highest-ranked player in the next lowest group
            next_group_index = i + 1
            while next_group_index < len(sorted_result_groups):
                next_result, next_group = sorted_result_groups[next_group_index]
                if len(next_group) > 0:
                    odd_player = group[0]
                    random.shuffle(next_group)
                    pair = (group[0], next_group[0])
                    while pair in previous_pairings or pair[::-1] in previous_pairings:
                        random.shuffle(next_group)
                        random.shuffle(group)# Shuffle players again to try different pairings
                        pair = (group[0], next_group[0])
                        if len(next_group) == 3:
                            pair2 = (next_group[1], next_group[2])
                            while pair2 in previous_pairings or pair[::-1] in previous_pairings:
                                random.shuffle(next_group)
                                pair = (group[0], next_group[0])
                            if len(group) == 3:
                                pair3 = ((group[1], group[2]))
                                while pair3 in previous_pairings or pair[::-1] in previous_pairings:
                                    random.shuffle(group)
                                    pair = (group[0], next_group[0])
                    odd_player = group.pop()
                    paired_player = next_group.pop(0)
                    pairings.append((odd_player, paired_player))
                    previous_pairings.add((odd_player, paired_player))
                    break
                next_group_index += 1
            else:
                # If no suitable pairing found, give the odd player a bye (free win)
                odd_player = group.pop()
                results[odd_player] = 1
        random.shuffle(group)  # Randomize player order within the group
        for j in range(0, len(group), 2):
            pair = (group[j], group[j+1])
            while pair in previous_pairings or pair[::-1] in previous_pairings:
                random.shuffle(group)  # Shuffle players again to try different pairings
                pair = (group[j], group[j+1])
            pairings.append(pair)
            previous_pairings.add(pair)
    
    return pairings, previous_pairings

def simulate_round(pairings):
    # Simulate games for each pairing
    results = {}
    for pair in pairings:
        # Simulate game between pair[0] and pair[1]
        # Update results based on game outcome (win, loss, draw)
        # For simplicity, let's assume random results
        Coin_Flip = random.randint(1,2)
        if Coin_Flip == 1:
            Hero1 = Player_List.get(pair[0])
            Hero2 = Player_List.get(pair[1])
            Weight = Matchups[Hero1]["First"][Hero2]
        elif Coin_Flip == 2:
            Hero1 = Player_List.get(pair[0])
            Hero2 = Player_List.get(pair[1])
            Weight = Matchups[Hero1]["Second"][Hero2]
        Deceider = round(random.uniform(0,1),2)
        results[pair[0]] = 'win' if Deceider <= Weight else 'loss' if Deceider > Weight else 'draw'
        results[pair[1]] = 'win' if results[pair[0]] == 'loss' else 'loss' if results[pair[0]] == 'win' else 'draw'
    return results


